var getNotifications = async (texts5, data) => {
  const kanalerToMetadata = (kanaler) => {
    if (kanaler.includes("SMS") && kanaler.includes("EPOST")) {
      return texts5.notified_SMS_and_EPOST;
    } else if (kanaler.includes("SMS")) {
      return texts5.notified_SMS;
    } else if (kanaler.includes("EPOST")) {
      return texts5.notified_EPOST;
    } else {
      return;
    }
  };
  const oppgaveToNotifiction = (oppgave) => ({
    title: texts5.task,
    text: oppgave.isMasked ? texts5.masked_task_text : oppgave.tekst ?? "",
    date: oppgave.tidspunkt,
    icon: TaskIcon(),
    metadata: kanalerToMetadata(oppgave.eksternVarslingKanaler),
    isArchivable: false,
    link: oppgave.link ?? "",
    id: oppgave.eventId,
    amplitudeKomponent: "varsel-oppgave"
  });
  const beskjedToNotification = (beskjed) => ({
    title: texts5.message,
    text: beskjed.isMasked ? texts5.masked_message_text : beskjed.tekst ?? "",
    date: beskjed.tidspunkt,
    icon: MessageIcon(),
    metadata: kanalerToMetadata(beskjed.eksternVarslingKanaler),
    isArchivable: !beskjed.link,
    link: beskjed.link ?? "",
    id: beskjed.eventId,
    amplitudeKomponent: "varsel-beskjed"
  });
  return Promise.resolve([
    ...data?.oppgaver.map(oppgaveToNotifiction) || [],
    ...data?.beskjeder.map(beskjedToNotification) || []
  ]);
};
